import React from "react";

function Header() {
  return (
    <div className="header__container">
      <img className="logo" src="./logo.png"></img>
      <span className="title">COZ Shopping</span>
      <img className="dropdown" src="./dropdown.svg"></img>
    </div>
  );
}

export default Header;
